const container = document.getElementById("cardContainer");

people.forEach((person) => {
  const card = document.createElement("div");
  card.classList.add("cards-width-max", "column");

  const info = document.createElement("p");
  info.classList.add("para-18");
  info.textContent =
    person.info ||
    "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.";

  const flexBox = document.createElement("div");
  flexBox.classList.add("flex");

  const img = document.createElement("img");
  img.src = "/assets/images/avater1.png";
  img.alt = "";
  img.classList.add("avater-image");

  const textBox = document.createElement("div");

  const name = document.createElement("p");
  name.textContent = person.name;

  const designation = document.createElement("p");
  designation.classList.add("para-16");
  designation.textContent = person.designation;

  const ratingSvg = person.getRating(); // returns a <div> with SVG

  textBox.appendChild(name);
  textBox.appendChild(designation);

  flexBox.appendChild(img);
  flexBox.appendChild(textBox);

  card.appendChild(ratingSvg);
  card.appendChild(info);
  card.appendChild(flexBox);

  container.appendChild(card);
});

